import { StyleSheet } from "react-native";

const styles = StyleSheet.create({
    container: {
      flex: 1,
      backgroundColor: '#fff',
      alignItems: 'center',
      justifyContent: 'center',
    },
    texinput:{
      marginTop:10,
      width: "75%",
      backgroundColor:'#fff',
    },
    picker:{
      marginTop:15,
      width: "75%",
      height: "7%",
      backgroundColor:'#fff',
      borderRadius: "5px",
    },
    view: {
      position:'absolute'
    },
    texinputOthers:{
      marginTop:15,
      width: "100%",
      height: "7%",
      backgroundColor:'#fff',
      borderRadius: "5px",
    }
  });

export {styles}
